Este poema es de Dionisio Ridruejo (1912-1975), poeta español perteneciente a la Generación del 36. El poema está incluido en su libro "Cuaderno Catalán" (1965) y es un soneto dedicado a la ciudad de Valladolid, donde el poeta pasó parte de su juventud.
